import React from "react";

function PatientDashboard() {
    return (
        <div style={styles.page}>
            <h1>Bienvenue sur votre tableau de bord Patient</h1>
            <p>Consultez vos états de santé et vos notifications.</p>
        </div>
    );
}

const styles = {
    page: {
        textAlign: "center",
        padding: "50px",
    },
};

export default PatientDashboard;
